    false,nt"url": null,nt"notes": "This narrative report for Tamarac National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1954. The report begins by summarizing the weather conditions, water conditions,
    food and cover, and wildfires during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and collections and receipts. Resource
    management is outlined; topics include grazing, haying, fur harvesting, and timber
    removal. The public relations section of the report describes public uses, Refuge
    visitors, Refuge participation, hunting, fishing, and violations. Items of interest
    and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
